import React from 'react';

import { Collapse } from 'antd';

const { Panel } = Collapse;

function AppFaq(){
    return (
        <div className = 'block faqBlock'>
            <div className = 'container-fluid'>
            <Collapse defaultActiveKey={['1']}>
    <Panel header="How do I manage my Account?" key="1">
      <p>Collapse content</p>
    </Panel>
    <Panel header="How do I change my password?" key="2">
      <p>Collapse content</p>
    </Panel>
    <Panel header="What special features are for Admin?" key="3">
      <p>Collapse content</p>
    </Panel>
    <Panel header="What special features are for Teaching staffs?" key="4">
      <p>Collapse content</p>
    </Panel>
  </Collapse> 
            </div>
        </div>
    );
}

export default AppFaq;
